import React from 'react';
import styled from 'styled-components';
import Plx from 'react-plx';
import {
  customerPlx,
  yellowBlockPlx,
} from '../plxSettings'

const StyledSlideSix = styled.div`
  position: relative;
  height: 100vh;
  width: 100vw;

  #white-car {
    position: absolute;
    bottom: 8vh;
    left: 18vw;
    width: 60vw;
  }

  .yellow-block-plx {
    height: 80vh;
    width: 10vw;
    position: absolute;
    left: 5vw;
    bottom: 0px;
    transform-origin: center left;

    #yellow-block {
      background: #FAC943;
      height: 100%;
      width: 100%;
    }
  }

  .customer-plx {
    opacity: 0;
    height: 75vh;
    position: absolute;
    bottom: 20vh;
    left: 5vh;

    #customer-img {
      transform: scaleX(-1);
    }
  }
`;

function SlideSix() {
  return (
    <StyledSlideSix>
      <Plx
        className='yellow-block-plx'
        parallaxData={yellowBlockPlx}
      >
        <div id='yellow-block' />
      </Plx>
      <Plx
        className='customer-plx'
        parallaxData={customerPlx}
      >
        <img id='customer-img' src='images/alex.png' alt='customer' /> 
      </Plx>
      {/* <img id='white-car' src='images/white_car_right.png' alt='white sports car' /> */}
    </StyledSlideSix>
  );
}

export default SlideSix;
